class App extends React.Component {
  constructor() {
    super();
    this.state = {
      count: 0,
      Values: [],
    };
    this.Addvalue = this.Addvalue.bind(this);
  }

  increase(prop) {
    let floors = [...this.state.Values];

    // Add item to it
    floors.push({ prop });

    // Set state
    this.setState({ floors });
    //this.setState({ Values: Values.push(prop) });
  }

  render() {
    return (
      <div style={{ margin: "50px" }}>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="standard-basic"
              label="Standard"
              variant="standard"
              sx={{
                width: "80%",
              }}
            />

            <Button
              variant="contained"
              sx={{
                width: "92px !important",
              }}
              startIcon={<AddCircle />}
              onClick={this.Addvalue}
            >
              Add
            </Button>
          </Box>
        </Stack>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <List
              sx={{
                width: "100%",
                maxWidth: 500,
                bgcolor: "background.paper",
                position: "relative",
                overflow: "auto",
                maxHeight: 300,
                "& ul": { padding: 0 },
              }}
              subheader={<li />}
            >
              {[0, 1, 2, 3, 4].map((sectionId) => (
                <li key={`section-${sectionId}`}>
                  <ul>
                    <ListSubheader>{`I'm sticky ${sectionId}`}</ListSubheader>
                    {/* {[0, 1, 2].map((item) => (
